import React from 'react';

interface AnchorProps {
  href?: string;
  [key: string]: any;
}

export const Anchor: React.FC<AnchorProps> = React.forwardRef<HTMLAnchorElement, AnchorProps>(
  ({ href, children, ...props }, ref) => (
    <a ref={ref} href={href} {...props}>
      {children}
    </a>
  ),
);
